using System;
using System.Collections.Generic;
using System.Linq;
using System.Text;
using System.Threading.Tasks;

namespace First_Unique_Character_in_a_String
{
    class Program
    {
        static void Main(string[] args)
        {
            //Console.WriteLine(FirstUniqueChar(""));
            firstUniqChar("abcffffgg");
        }

        public static int FirstUniqueChar(string s)
        {
            char[] charArry = s.ToArray();
            var singleChar = charArry.GroupBy(e => e).Where(e => e.ToList().Count == 1).FirstOrDefault();



            if(singleChar != null)
            {
                var selected = singleChar.ToList()[0];
                return s.IndexOf(selected);
            }

            return -1;



        }

        public static int firstUniqChar(String s)
        {
            int[] freq = new int[26];
            for (int i = 0; i < s.Length; i++)
                freq[s[i]-'a']++;
            for (int i = 0; i < s.Length; i++)
                if (freq[s[i]-'a'] == 1)
                    return i;
            return -1;
        }
    }
}
